name: list-collaboration-configured-model-algorithm-associations
description: Returns a list of the configured model algorithm associations in a collaboration.
flags:
    --collaboration-identifier=!: The collaboration ID of the collaboration that contains the configured model algorithm associations that you are interested in.
    --max-results=: The maximum size of the results that is returned per call.
    --next-token=: The token value retrieved from a previous call to access the next page of results.
